import { Navigate } from "react-router-dom";
import { useAuth } from "../hooks/authProvider";

export const ProtectedRoute = ({ children }) => {
  const { user } = null;
  if (!user) {
    // user is not authenticated
    return <Navigate to="/" />;
  }
  return children;
};
